                                "content": "Risk is something we face daily. However, some people are obviously more willing to take risks than others.\nâ‘¡Biologists appear to have discovered a physical reason that explains why some people are risk-takers. Dopamine is a neurotransmitter, a chemical that spreads signals between nerve cells. It is linked to the brains reward system and is the chemical that makes us feel good, and scientists believe it to be linked to risk-taking. Our nerve cells have dopamine receptors(æŽ¥æ”¶å™¨) which control the amount of dopamine that each cell receives. But not all receptors may be active. When a person has few active receptors to control the amount of dopamine that is received, a cell can become flooded resulting in an extreme feeling of happiness.\nResearchers at Vanderbilt University and Albert Einstein College of Medicine asked 34 men and women to complete a questionnaire about their risk taking to assess whether they seek new opportunities or are cautious in life. The results of the research were consistent with similar studies carried out with rats, and had the same outcome. It concluded that people who are risk-takers have fewer dopamine receptors than people who are not. This suggests that the rush of pleasure a risk taker receives when a cell becomes flooded with dopamine can become addictive for some people. They therefore pursue new and exciting activities in order to try to repeat this feeling, and as a result their concern for risk becomes considerably reduced.\nâ‘£Dopamine gives us a biological reason for risk-taking, but scientists believe there may be psychological reasons too. Sensation-seeking is a personality characteristic that describes the desire to find activities that bring us pleasure. In 1964, psychologist Marvin Zuckerman created the sensation-seeking scale. His 40-item questionnaire, still used today, was given to people who were active in seeking new activities, and to people who were more satisfied with a quiet life. While risk-taking is not a characteristic in itself, it is very much associated with sensation-seeking, as a high sensation-seeker does not evaluate risk in the same way that a low sensation-seeker does. A desire to achieve pleasure means that there is a greater willingness to take more risks.\nâ‘¤ There are both biological and psychological explanations as to why some people may choose to take more risks than others. However, none of these explanations are definitive.\n\n63. If a person has fewer active dopamine receptors,\nA. he is less likely to feel happy\nB. he is more willing to take risks\nC. he will eventually become dopamine-addictive\nD. he is poorer at controlling the amount of dopamine\n64. The underlined phrase \"consistent with\" is closest to \" \" in meaning.\nA. contrary to\nB. in agreement with\nC. at the cost of\nD. persistent in\n65. What can be concluded from paragraph 4?\nA. The longing for pleasure may lead to risk taking.\nB. A willingness to take more risks can be cultivated.\nC. The sensation-seeking scale can help to evaluate risk.\nD. High sensation-seekers are more common than low ones.\n66. This passage mainly talks about\nA. when we learn to take risks\nB. how risk-taking benefits us\nC. what makes risk-takers\nD. why we should take risks"
